import React, { useEffect, useState } from "react";

const Cart = () => {
    const [Cart, setCart] = useState([]);
    useEffect(() => {
        fetch('https://backendapi.turing.com/shoppingcart/5')
        .then(res => res.json())
        .then(data => setCart(data))
    }, [] )
    
    return (
        <div className="container">
            <div className="modal"></div>
            <div className="modal__content">
                <i className="modal__close far fa-times-circle"></i>
                <div className="modal__left">
                    <img className="modal__img" src="" alt=""/>
                </div>
                <div className="modal__right">
                    <div className="detail">
                        <h2 className="detail__title"></h2>
                        <p className="detail__description">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Error, labore quaerat
          magni ad dolores libero culpa ipsa fugit voluptates ipsam!</p>
                        <p className="detail__price"></p>
                        <p className="detail__bagBtn">add to bag</p>
                    </div>
                </div>
            </div>
        </div>
     );
}
 
export default Cart;
